static void
decode_UCNs_to_utf8 (char *dest, const char *src, size_t n)
{
  bool is_first = true;
  const char *s = src;
  size_t chars_left = n - 1;

  while (*src)
    {
      if (*src == '\\')
        {
          ++src;
          char32_t c = 0;
          if (*src == 'u')
            {
              c = universalEscape(&src, 4);
            }
          else  // U - the lexer only accepts \u and \U escapes in identifiers
            {
              c = universalEscape(&src, 8);
            }
          if (!is_UCN_valid_in_idf(c, is_first))
            {
              werror(E_INVALID_UNIVERSAL_IDENTIFIER, s);
            }

          if (c >= 0x10000)
            {
              if (chars_left < 4)
                break;
              *(dest++) = 0xf0 | (c >> 18);
              *(dest++) = 0x80 | ((c >> 12) & 0x3f);
              *(dest++) = 0x80 | ((c >> 6) & 0x3f);
              *(dest++) = 0x80 | (c & 0x3f);
              chars_left -= 4;
            }
          else if (c >= 0x800)
            {
              if (chars_left < 3)
                break;
              *(dest++) = 0xe0 | (c >> 12);
              *(dest++) = 0x80 | ((c >> 6) & 0x3f);
              *(dest++) = 0x80 | (c & 0x3f);
              chars_left -= 3;
            }
          else  // ASCII characters already eliminated by validity check => no further check here
            {
              if (chars_left < 2)
                break;
              *(dest++) = 0xc0 | (c >> 6);
              *(dest++) = 0x80 | (c & 0x3f);
              chars_left -= 2;
            }
        }
      else
        {
          if (chars_left < 1)
            break;
          *(dest++) = *(src++);
          chars_left--;
        }
      is_first = false;
    }
  *dest = '\0';
}

